import numpy as np
import pandas as pd
import matplotlib.pyplot as plt
from sklearn.linear_model import LinearRegression
from sklearn.metrics import mean_absolute_error, mean_squared_error, r2_score

data = np.genfromtxt('Копия ex1data2.txt', delimiter=',') # загрузка данных из файла

# линейная модель, учитывающая только размер жилья
# X - столбец 1, Y - столбец 3 из файла
x, y = data[:,0], data[:,2]

# удаление значений NaN
x = x[~np.isnan(y)]
y = y[~np.isnan(y)]

# вычисление параметров модели
# линейная модель и полиномиальные модели (2 и 3 степени)
for model_deg in [1, 2, 3]:
    # подбор параметров модели
    f1p, residuals, rank, sv, rcond = np.polyfit(x, y, model_deg, full=True)
    f1 = np.poly1d(f1p)
    # точки для построения линии регрессии
    fx = np.linspace(min(x), max(x), 500)

    # построение графика
    plt.scatter(x, y, s=25) # точки
    plt.plot(fx, f1(fx), linewidth=1.5, color='green') # линия регрессии
    plt.title('Зависимость стоимости дома от его площади')
    plt.xlabel('Площадь')
    plt.ylabel('Стомость')
    plt.grid(True)
    plt.show()

    # вычисление и печать прогнозных значений для X = 1650 и X = 2200
    for val in [1650, 2200]:
        print(f'square_house = {val}, cost = {f1(val):.2f}')

    print()

    # вычисление прогнозных значений для всех X (для расчёта показателей ошибки)
    y_predicted = [f1(val) for val in x]

    # показатели (метрики) качества модели
    # с округлением до 2 знаков после запятой
    print('R^2: {:.4f}'.format(r2_score(y, y_predicted)))
    print('MAE: {:.4f}'.format(mean_absolute_error(y, y_predicted)))
    print('MSE: {:.4f}'.format(mean_squared_error(y, y_predicted)))
    print('RMSE: {:.4f}'.format(np.sqrt(mean_squared_error(y, y_predicted))))

    print('-' * 50) # для удобства чтения данных





# линейная модель, учитывающая размер жилья и кол-во комнат
# X - столбцы 1 и 2, Y - столбец 3 из файла
x, y = data[:,[0,1]], data[:,2]

# удаление значений NaN
x = x[~np.isnan(y)]
y = y[~np.isnan(y)]

# подбор параметров модели
model = LinearRegression()
model.fit(x, y)

# вычисление и печать прогнозных значений для square_house=1650, number_of_rooms=3
# и square_house=2200, number_of_rooms=4
x_test = [[1650, 3], [2200, 4]]
y_pred = model.predict(x_test)
for test_val, pred_val in zip(x_test, y_pred):
    print('square_house = {}, rooms = {}, cost = {:.2f}'.format(*test_val, pred_val))

# вычисление прогнозных значений для всех X (для расчёта показателей ошибки)
y_predicted = model.predict(x)

print()

# показатели (метрики) качества модели
# с округлением до 2 знаков после запятой
print('R^2: {:.4f}'.format(r2_score(y, y_predicted)))
print('MAE: {:.4f}'.format(mean_absolute_error(y, y_predicted)))
print('MSE: {:.4f}'.format(mean_squared_error(y, y_predicted)))
print('RMSE: {:.4f}'.format(np.sqrt(mean_squared_error(y, y_predicted))))

